import logo from "./logo.svg";
import "./App.css";
import { Route, Router, Switch } from "react-router";
import Home from "./Components/Home/Home/Home";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/">
          <Home></Home>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
